import { Link } from "react-router-dom";

const AnimeList = ({anime}) => {
    return ( 
        anime.map((ani) => (
            <div className="animeList">
                
                    <tr>
                    
                        <td>{ani.id}</td>
                        <td><img src={ani.pic} /></td>

                        
                        <td>{ani.title}</td>

                        <td>{ani.score}</td>
                    
                    </tr>
                
            </div>
        ))

     );
}
 
export default AnimeList;
